import React from 'react';

const GoogleLoginComponent = () => {
  const handleLogin = () => {
    // Redirect to Laravel backend route that initiates OAuth
    window.location.href = 'http://localhost:8000/auth/redirect';
  };

  return (
    <div>
      <p style={{ padding: "25%" }}>
        <img src="/media/empty.png" alt="" />
      </p>
      <button
        onClick={handleLogin}
        className="btn flex-1 py-2"
        style={{
          background: "#E2545E",
          color: "white",
          alignItems: "center",
          marginLeft: "25%",
        }}
      >
        Connect With Gmail
      </button>
    </div>
  );
};

export default GoogleLoginComponent;
